import React from 'react';
import './Home.css';
import SearchBar from "./components/SearchBar";
import Geocode from "react-geocode";

class Home extends React.Component{
  state={
    address:""
  }

  findParking = (input)=>{
    fetch(`http://geocode.arcgis.com/arcgis/rest/services/World/GeocodeServer/findAddressCandidates?address=${input}`)
    .then(res => console.log(res));
  }
render(){
  return (
      <div className="home-container">
      <header className='header'>
            <div className="header__logo-box">
            </div>
            <div className="header__text-box">
              <h1 className="heading-primary">
                <span className="heading-primary--main">Open Spaces</span>
                <span className="heading-primary--sub">Find Parking</span>
              </h1>
              <SearchBar findParking={this.findParking}/>
            </div>
            <br/>
            </header>
      </div>
    );
  }

}
// <img src= {img} alt="Logo" className="header__logo"/>


export default Home;
